                if (ii_cnt == 0)
                    xprintf('There are no fractional columns');
                else if (ii_cnt == 1)
                    xprintf('There is one fractional column, integer infeasibility is ' + ii_sum + '');
                else
                    xprintf('There are ' + ii_cnt + ' fractional columns, integer infeasibility is ' + ii_sum + '');
