            mip.mip_obj = mip.obj_val;
            for (i = 1; i <= mip.m; i++) {
                var row = mip.row[i];
                row.mipx = row.prim;
            }
            for (j = 1; j <= mip.n; j++) {
                var col = mip.col[j];
                if (col.kind == GLP_CV)
                    col.mipx = col.prim;
                else if (col.kind == GLP_IV) {
                    col.mipx = Math.floor(col.prim + 0.5);
                } else
                    xassert(col != col);
            }
