                T.curr.lp_obj = dn_lp;
                if (mip.dir == GLP_MIN) {
                    if (T.curr.bound < dn_bnd)
                        T.curr.bound = dn_bnd;
                } else if (mip.dir == GLP_MAX) {
                    if (T.curr.bound > dn_bnd)
                        T.curr.bound = dn_bnd;
                } else
                    xassert(mip != mip);
