        var vr_cap = luf.vr_cap;
        var vc_ptr = luf.vc_ptr;
        var vc_len = luf.vc_len;
        var vc_cap = luf.vc_cap;
        var sv_ind = luf.sv_ind;
        var sv_val = luf.sv_val;
        var sv_next = luf.sv_next;
        var sv_beg = 1;
        var i, j, k;
